pragma solidity ^0.4.4;
contract Ownable{
   address public owner;
   constructor() public {
       owner=msg.sender;
   }
   modifier ownerOnly{
       require(owner==msg.sender);
       _;
   }
   function transferOwnership(address newOwner) internal ownerOnly{
       require(newOwner!=address(0));
       owner=newOwner;
   }
}

contract TradeRegulation is Ownable{
   enum Status{
       NOT_UPLOADED,
       UNDER_REVIEW,
       APPROVED,
       REJECTED,
       PARTIALLY_APPROVED
   }
   struct doc{
       mapping(uint=>string) versionDir;
       Status stat;
       uint version;
   }
   struct LetterOfCredit{
       uint numDays;
       uint creditAmt;
       Status stat;
   }
   struct Invoice{
       uint numDays;
       uint owedAmt;
       Status stat;
   }
   struct Role{
       string buyer;
       string seller;
       string shipper;
       string insurer;
       string banker;
   }
   struct Tx{
       address[] tradeParties;
    //   mapping(address=>Role rol);

   }
}
